<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Welcome to My Website</title>
    <style>
        body {
            background-color: #f0f0f0; /* Light gray background */
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }

        .content {
            text-align: center;
            overflow: hidden; /* Hide overflow for animation effect */
        }

        h1 {
            color: transparent; /* Make text transparent */
            font-size: 3em;
            margin-bottom: 20px;
            font-weight: 900; /* Bold font weight */
            animation: flowText 10s linear infinite; /* Animation */
            background: linear-gradient(to right, #33daff, #5733ff, #ff33d7); /* Gradient */
            -webkit-background-clip: text; /* Apply gradient to text */
            -webkit-text-fill-color: transparent; /* Make text transparent */
        }

        @keyframes flowText {
            0% { background-position: 0 0; }
            100% { background-position: 100% 0; }
        }

        p {
            color: #555; /* Medium gray text */
            font-size: 1em;
            text-shadow: 1px 1px 2px rgba(0, 3, 0, 0.4);
        }

        /* Add animation for rotating colors inside "nginx" */
        h1::before {
            content: "nginx";
            position: absolute;
            animation: rotateColors 5s linear infinite;
        }

        @keyframes rotateColors {
            0% { color: #33daff; }
            50% { color: #5733ff; }
            100% { color: #ff33d7; }
        }
